import React from "react";
import "./header.css";
import { resumeData } from "../../resumeData";

function Header() {
  return (
    <div
      className="header row"
      style={{
        background:
          "#161415 url('https://geo.img.pmdstatic.net/fit/http.3A.2F.2Fprd2-bone-image.2Es3-website-eu-west-1.2Eamazonaws.2Ecom.2Fgeo.2F2020.2F01.2F06.2Fa343e643-51cc-491b-9df1-9807b718efe1.2Ejpeg/1800x675/background-color/ffffff/quality/90/picture.jpg') top center",
      }}
    >
      <div className="col-6 text-center" id="hleft">
        <h1 id="name">{resumeData.header.name || "No data"}</h1>
        <br />
        <h3 id="job">{resumeData.header.job || "No data"}</h3>
      </div>
      <div className="col-5 text-right" id="hright">
        <br />
        <h4 id="phone">{resumeData.header.phone || "No data"}</h4>
        <h4 id="mail">{resumeData.header.mail || "No data"}</h4>
        <h4 id="portfolio">{resumeData.header.portfolio || "No data"}</h4>
      </div>
    </div>
  );
}

export default Header;
